vlocity.cardframework.registerModule.controller('EditBlockController', ['$scope', function($scope) {
     $scope.onClickEditBlockRecordSelector = function(control,checkboxInd,event,index){

         $scope.child.eleArray.forEach(function(children,index){
             if($scope.child.eleArray[index].response[control.selectCheckBox]){
               $scope.onClickEditBlockRecord($scope.child.eleArray[index],checkboxInd,event);
             }
         });

         $scope.bpTree.response[control.selectCheckBox] = null;

         if(!control.response[control.selectCheckBox])
         {
            $scope.onClickEditBlockRecord(control,checkboxInd,event);
            if(control.response.unique_key === undefined || control.response.unique_key === null){
             control.response.unique_key = new Date().getTime().toString();
            }
            $scope.bpTree.response[control.selectCheckBox] = control.response;


         } 

         $scope.bpTree.response[control.selectCheckBox+"_validation"] = !control.response[control.selectCheckBox];
     }

    $scope.currentPage = 0;
    $scope.pageSize = 10;
    $scope.numberOfPages=function(){
        return Math.ceil($scope.child.eleArray.length/$scope.pageSize);                
    }

    $scope.proceed = function(proceed){
        if(!proceed){
        if($scope.currentPage > 0){
            $scope.currentPage = $scope.currentPage-1
        }

        }else{
        if($scope.currentPage <= $scope.child.eleArray.length/$scope.pageSize -1 ){
            $scope.currentPage=$scope.currentPage+1
        }
        }
    }



      }]);

