vlocity.cardframework.registerModule.controller('tt_ProductSelectionController', ['$scope', function($scope) {

    $scope.Products=[];
    $scope.bpTree.response.selectedRow = null;
    console.log('Cp Check',$scope.bpTree.response);

    $scope.isObjectEmpty = function(obj){
       return Object.keys(obj).length === 0;
    }

    $scope.bpTree.response.selectedRow = null;  // initialize our variable to null
    $scope.setClickedRow = function(index, control){
        console.log('inside click');
        if ($scope.bpTree.response.selectedRow === index) {
            $scope.bpTree.response.selectedRow = null;
        }
        else {
            $scope.bpTree.response.selectedRow = index;
        }

    }


    $scope.init = function(control){

        $scope.currentPage = 1;
        $scope.isNext =false;
        $scope.pageSize = 10 ;
        $scope.startIndex = 0;
        $scope.endIndex = $scope.pageSize;
        console.log('inside init', control);

        //if(control.vlcSI[control.itemsKey][0].actions || control.vlcSI[control.itemsKey][0].length/$scope.pageSize  
    }

    $scope.$watchCollection('baseCtrl.prototype.$scope.control.vlcSI.recSet', function (newValue, oldValue, scope) {
        //Do anything with $scope.letters
        console.log('values now are => recSet' , newValue);
    });

    $scope.Next = function(control,scp){ 
        if(control.vlcSI[control.itemsKey][0].records.length == $scope.currentPage*$scope.pageSize &&
               control.vlcSI[control.itemsKey][0].actions){

            control.vlcSI[control.itemsKey][0].actions.nextproducts.remote.params.filters = $scope.bpTree.response.TargetproductList ;
            control.vlcSI[control.itemsKey][0].actions.nextproducts.remote.params.offsetSize += $scope.pageSize
            $scope.baseCtrl.loadMoreProducts(control,scp)
                        .then(function(result){

                               if(control.vlcSI[control.itemsKey][0].actions){
                               $scope.isNext = true;

                               }
                               else
                               $scope.isNext = false ;
                                $scope.currentPage++;
            $scope.startIndex = $scope.endIndex;
            $scope.endIndex += $scope.pageSize; 
                               $scope.items = control.vlcSI[control.itemsKey][0].records.slice($scope.startIndex,$scope.endIndex); 
            });               

            } 
            else  if (control.vlcSI[control.itemsKey][0].records.length < $scope.currentPage*$scope.pageSize ){
              $scope.isNext = false ;  

            }
            else if (control.vlcSI[control.itemsKey][0].records.length > $scope.currentPage*$scope.pageSize ){
                $scope.currentPage++;
                $scope.startIndex = $scope.endIndex;
                $scope.endIndex += $scope.pageSize; 

               $scope.items = control.vlcSI[control.itemsKey][0].records.slice($scope.startIndex,$scope.endIndex);
               if(control.vlcSI[control.itemsKey][0].actions){
                    $scope.isNext = true;
                } else
                    $scope.isNext = false ;
            }
         }

         $scope.Previous = function(control){
            $scope.currentPage--;
            $scope.endIndex = $scope.startIndex ;
            $scope.startIndex -= $scope.pageSize; 

            $scope.items = control.vlcSI[control.itemsKey][0].records.slice($scope.startIndex,$scope.endIndex);  
            console.log('Cp actions',control.vlcSI[control.itemsKey][0].actions); 
            if(control.vlcSI[control.itemsKey][0].records.length > $scope.currentPage*$scope.pageSize)
            $scope.isNext = true;
    }

    $scope.AddPBE = function(control, option, index, scp, bFlip) {
        if(control === undefined || control === null || option === undefined || option === null)
            return;  
            var response = '';
            var responseJson = {"ItemName":"","ItemId":""};

        // multi-select, single select
        var bSetVal = true;
        var recSet = control.vlcSI[control.itemsKey][0].records;

        for(var i=0; i<recSet.length; i++)
        {
            if(option.vlcSelected === true && option.$$hashKey !== recSet[i].$$hashKey && control.propSetMap.selectMode === 'Single')
                recSet[i].vlcSelected = false;                     
            if(recSet[i].vlcSelected === true){
                response = recSet[i].Name.value+','+recSet[i].Id.value; //commented by prashant
                responseJson['ItemName'] = recSet[i].Name.value;
                responseJson['ItemId'] = recSet[i].Id.value;
                responseJson['ItemProductCode'] = recSet[i].ProductCode.value;
            }  
        }

        if(response.length > 0)
            control.response = responseJson;
        else
            control.response = null;

        if(control.propSetMap.dataJSON === true)
            scp.aggregate(scp, control.index, control.indexInParent, true, -1);
    }; 
}]);

